tables.table_schema:
CREATE TABLE SwimmingEvents (
  EventID INT PRIMARY KEY,
  EventName VARCHAR(255) NOT NULL,
  EventDate DATE NOT NULL
);

CREATE TABLE EventRankings (
  RankingID INT PRIMARY KEY,
  EventID INT NOT NULL,
  SwimmerID INT NOT NULL,
  Rank INT NOT NULL
);

CREATE TABLE Event (
  Event_ID INT PRIMARY KEY,
  Event_Name VARCHAR(255) NOT NULL,
  Event_Date DATE
);

CREATE TABLE Participant (
  Participant_ID INT PRIMARY KEY,
  Participant_Name VARCHAR(255) NOT NULL,
  Participant_Country VARCHAR(50)
);

CREATE TABLE event (
    event_id INT PRIMARY KEY,
    event_name VARCHAR(255) NOT NULL,
    event_date DATE NOT NULL,
    event_location VARCHAR(255) NOT NULL
);

CREATE TABLE swimmer (
    swimmer_id INT PRIMARY KEY,
    swimmer_name VARCHAR(255) NOT NULL,
    swimmer_country VARCHAR(100) NOT NULL,
    swimmer_birthdate DATE
);

CREATE TABLE team (
    team_id INT PRIMARY KEY,
    team_name VARCHAR(255) NOT NULL,
    team_country VARCHAR(100) NOT NULL
);
